import React from 'react';

function FeedbackCard(props){
	return(
		<div className='FeedbackCard'>
			<img src={props.Image} alt='Profile'/>
			<h6>@{props.Username}</h6>
			<p>{props.Message}</p>
			<p><em>Date: {props.Date}12-02-2021</em></p>
		</div>
	);
}

export default FeedbackCard;
